<?php
/**
 * The Menu Class.
 *
 * @package WapuuGotchi
 */

namespace Wapuugotchi\Core;

if ( ! defined( 'ABSPATH' ) ) {
	exit();
}

/**
 * Class Menu
 */
class AdminBar {
	const WAPUU_ICON = 'data:image/svg+xml;base64,';

	/**
	 * "Constructor" of this Class
	 */
	public function __construct() {
		\add_action( 'admin_bar_menu', array( $this, 'custom_admin_bar_menu' ), PHP_INT_MAX );
	}

	/**
	 * Implements WapuuGotchi into the admin bar.
	 *
	 * @param array $admin_bar The admin bar.
	 *
	 * @return void
	 */
	public function custom_admin_bar_menu( $admin_bar ) {
		$elements = $this->get_submenu_elements();
		if ( empty( $elements ) ) {
			return;
		}

		$first_element = $elements[0];
		foreach ( $elements as $element ) {
			$parent = 'wapuugotchi_admin_bar_menu';
			if ( isset( $element['sub'] ) && true === $element['sub'] ) {
				$parent = 'wapuugotchi_admin_bar_menu-sub';
			}

			$admin_bar->add_menu(
				array(
					'id'     => 'wapuugotchi_admin_bar_menu_' . \sha1( $element['title'] ),
					'parent' => $parent,
					'group'  => null,
					'title'  => $element['title'],
					'href'   => $element['href'],
					'meta'   => $element['meta'],
				)
			);
		}

		$admin_bar->add_menu(
			array(
				'id'     => 'wapuugotchi_admin_bar_menu',
				'parent' => 'top-secondary',
				'group'  => null,
				'title'  => '<img style="width: 50px; margin-top: 8px"src="' . self::WAPUU_ICON . '"></img>',
				'href'   => $first_element['href'],
			)
		);
		$admin_bar->add_menu(
			array(
				'id'     => 'wapuugotchi_admin_bar_menu-sub',
				'parent' => 'wapuugotchi_admin_bar_menu',
				'group'  => true,
			)
		);
	}

	/**
	 * Get validated $admin_bar entries.
	 *
	 * @return array
	 */
	private function get_submenu_elements() {
		$elements = \apply_filters( 'wapuugotchi_add_admin_bar_elements', array() );
		if ( ! is_array( $elements ) ) {
			return array();
		}

		$result = array();
		foreach ( $elements as $element ) {
			if ( false === $this->is_element_valid( $element ) ) {
				continue;
			}

			$result[] = $element;
		}

		return $result;
	}

	/**
	 * Check if the admin bar element is valid.
	 *
	 * @param array $element The admin bar element.
	 *
	 * @return bool
	 */
	private function is_element_valid( $element ) {
		if ( ! is_array( $element ) ) {
			return false;
		}

		if ( ! isset( $element['title'], $element['href'], $element['meta'] ) ) {
			return false;
		}

		return true;
	}
}
